	transition: {
        duration: 2500
    }
});

function Update() {

	var x =counter;
				subsplit=splitInfo[x].split(",");
				var bcounter=1;
				for(z=0;z<subsplit.length-2;z+=2)
				{

					bcounter++;

					bestData[z/2+1] = parseFloat(subsplit[z+1]);
				}
				best[bcounter-1] = 20;//orig[orig.length-1];
				bestData[bcounter-1] = 13.78;//origData[origData.length-1];
				var newsplit=splitInfo[x+1].split(",");
				var wcounter=1;
				for(z=0;z<newsplit.length-2;z+=2)
				{
					wcounter++;
					worst[z/2+1] = parseFloat(newsplit[z]);
					worstData[z/2+1] = parseFloat(newsplit[z+1]);
				}
				worst[wcounter-1] = 20;//orig[orig.length-1]; 
				worstData[wcounter-1] = 13.78;//origData[origData.length-1];	
				
	counter+=2;
	chart.load({ 
		columns: [
			orig,
			best,
			worst,
			origData,
            bestData,
			worstData
			
		]
	});
}

function Start(){
	
	subsplit=splitInfo[0].split(",");
	for(z=0;z<subsplit.length;z+=2)
	{
		orig[z/2+1] = parseFloat(subsplit[z]);
		origData[z/2+1] = parseFloat(subsplit[z+1]);
	}
}

setInterval(Update, 3000);
